pub type VersionEditDeletedFileSet = HashSet<(i32,u64)>;

#[derive(Getters,MutGetters)]
#[getset(get="pub",get_mut="pub")]
pub struct VersionEdit  {
    comparator:           String,
    log_number:           u64,
    prev_log_number:      u64,
    next_file_number:     u64,
    last_sequence:        SequenceNumber,
    has_comparator:       bool,
    has_log_number:       bool,
    has_prev_log_number:  bool,
    has_next_file_number: bool,
    has_last_sequence:    bool,
    compact_pointers:     Vec<(i32,InternalKey)>,
    deleted_files:        VersionEditDeletedFileSet,
    new_files:            Vec<(i32,FileMetaData)>,
}

pub fn get_level(input: &mut Slice, level: &mut i32) -> bool {
    let mut v: u32 = 0;
    if !get_varint32(input, &mut v) {
        return false;
    }
    *level = v as i32;
    true
}


pub fn get_internal_key(input: &mut Slice, key: &mut InternalKey) -> bool {
    let mut key_slice = Slice::default();
    if !get_length_prefixed_slice(input, &mut key_slice) {
        return false;
    }
    key.decode_from(&key_slice);
    true
}

impl VersionEdit {

    pub fn encode_to(&self, dst: *mut String) {
        trace!("VersionEdit::encode_to: encoding version edit");

        if dst.is_null() {
            error!("VersionEdit::encode_to: dst pointer is null");
            return;
        }

        // Ensure deterministic ordering for deleted_files so that
        // EncodeTo/DecodeFrom/EncodeTo produces identical manifest bytes.
        let mut deleted_files_sorted: Vec<(i32, u64)> =
            self.deleted_files().iter().copied().collect();
        deleted_files_sorted.sort_unstable();

        unsafe {
            if *self.has_comparator() {
                // kComparator = 1
                put_varint32(dst, 1);
                let comparator_slice = Slice::from(self.comparator());
                put_length_prefixed_slice(dst, &comparator_slice);
            }
            if *self.has_log_number() {
                // kLogNumber = 2
                put_varint32(dst, 2);
                put_varint64(dst, *self.log_number());
            }
            if *self.has_prev_log_number() {
                // kPrevLogNumber = 9
                put_varint32(dst, 9);
                put_varint64(dst, *self.prev_log_number());
            }
            if *self.has_next_file_number() {
                // kNextFileNumber = 3
                put_varint32(dst, 3);
                put_varint64(dst, *self.next_file_number());
            }
            if *self.has_last_sequence() {
                // kLastSequence = 4
                put_varint32(dst, 4);
                put_varint64(dst, *self.last_sequence() as u64);
            }

            for (level, key) in self.compact_pointers() {
                // kCompactPointer = 5
                put_varint32(dst, 5);
                put_varint32(dst, *level as u32);
                let encoded = key.encode();
                put_length_prefixed_slice(dst, &encoded);
            }

            for (level, number) in deleted_files_sorted {
                // kDeletedFile = 6
                put_varint32(dst, 6);
                put_varint32(dst, level as u32);
                put_varint64(dst, number);
            }

            for (level, f) in self.new_files() {
                // kNewFile = 7
                put_varint32(dst, 7);
                put_varint32(dst, *level as u32);
                put_varint64(dst, *f.number());
                put_varint64(dst, *f.file_size());

                let smallest_encoded = f.smallest().encode();
                put_length_prefixed_slice(dst, &smallest_encoded);

                let largest_encoded = f.largest().encode();
                put_length_prefixed_slice(dst, &largest_encoded);
            }
        }

        trace!("VersionEdit::encode_to: encoding completed");
    }
}

impl VersionEdit {

    /// Delete the specified "file" from the
    /// specified "level".
    /// 
    pub fn delete_file(&mut self, level: i32, file: u64) {
        trace!(
            "VersionEdit::delete_file: marking file {} for deletion at level {}",
            file,
            level
        );
        self.deleted_files_mut().insert((level, file));
    }
}

impl VersionEdit {

    pub fn debug_string(&self) -> String {
        trace!("VersionEdit::debug_string: generating human-readable summary");

        let mut r = String::from("VersionEdit {");

        if *self.has_comparator() {
            r.push_str("\n  Comparator: ");
            r.push_str(self.comparator());
        }
        if *self.has_log_number() {
            r.push_str("\n  LogNumber: ");
            r.push_str(&self.log_number().to_string());
        }
        if *self.has_prev_log_number() {
            r.push_str("\n  PrevLogNumber: ");
            r.push_str(&self.prev_log_number().to_string());
        }
        if *self.has_next_file_number() {
            r.push_str("\n  NextFile: ");
            r.push_str(&self.next_file_number().to_string());
        }
        if *self.has_last_sequence() {
            r.push_str("\n  LastSeq: ");
            r.push_str(&self.last_sequence().to_string());
        }

        for (level, key) in self.compact_pointers() {
            r.push_str("\n  CompactPointer: ");
            r.push_str(&level.to_string());
            r.push(' ');
            r.push_str(&key.debug_string());
        }

        for (level, number) in self.deleted_files() {
            r.push_str("\n  DeleteFile: ");
            r.push_str(&level.to_string());
            r.push(' ');
            r.push_str(&number.to_string());
        }

        for (level, f) in self.new_files() {
            r.push_str("\n  AddFile: ");
            r.push_str(&level.to_string());
            r.push(' ');
            r.push_str(&f.number().to_string());
            r.push(' ');
            r.push_str(&f.file_size().to_string());
            r.push(' ');
            r.push_str(&f.smallest().debug_string());
            r.push_str(" .. ");
            r.push_str(&f.largest().debug_string());
        }

        r.push_str("\n}\n");

        r
    }
}

impl Default for VersionEdit {

    fn default() -> Self {
        trace!("VersionEdit::default: constructing new empty version edit");
        VersionEdit {
            comparator: String::new(),
            log_number: 0,
            prev_log_number: 0,
            next_file_number: 0,
            last_sequence: 0,
            has_comparator: false,
            has_log_number: false,
            has_prev_log_number: false,
            has_next_file_number: false,
            has_last_sequence: false,
            compact_pointers: Vec::new(),
            deleted_files: VersionEditDeletedFileSet::default(),
            new_files: Vec::new(),
        }
    }
}

impl VersionEdit {

    pub fn set_comparator_name(&mut self, name: &Slice) {
        trace!("VersionEdit::set_comparator_name: setting comparator from slice");
        self.has_comparator = true;
        self.comparator = name.to_string();
        debug!(
            "VersionEdit::set_comparator_name: comparator set to '{}'",
            self.comparator
        );
    }

    pub fn set_log_number(&mut self, num: u64) {
        trace!("VersionEdit::set_log_number: num={}", num);
        self.has_log_number = true;
        self.log_number = num;
    }

    pub fn set_prev_log_number(&mut self, num: u64) {
        trace!("VersionEdit::set_prev_log_number: num={}", num);
        self.has_prev_log_number = true;
        self.prev_log_number = num;
    }

    pub fn set_next_file(&mut self, num: u64) {
        trace!("VersionEdit::set_next_file: num={}", num);
        self.has_next_file_number = true;
        self.next_file_number = num;
    }

    pub fn set_last_sequence(&mut self, seq: SequenceNumber) {
        trace!("VersionEdit::set_last_sequence: seq={}", seq);
        self.has_last_sequence = true;
        self.last_sequence = seq;
    }

    pub fn set_compact_pointer(&mut self, level: i32, key: &InternalKey) {
        trace!(
            "VersionEdit::set_compact_pointer: level={} key={:?}",
            level,
            key
        );
        self.compact_pointers.push((level, key.clone()));
    }

    pub fn reset_core_state(&mut self) {
        trace!(
            "VersionEdit::reset_core_state: resetting scalar state \
             and file collections (compact_pointers preserved)"
        );

        self.comparator.clear();
        self.log_number           = 0;
        self.prev_log_number      = 0;
        self.next_file_number     = 0;
        self.last_sequence        = 0;
        self.has_comparator       = false;
        self.has_log_number       = false;
        self.has_prev_log_number  = false;
        self.has_next_file_number = false;
        self.has_last_sequence    = false;

        self.deleted_files.clear();
        self.new_files.clear();

        debug!(
            "VersionEdit::reset_core_state: deleted_files_len={} \
             new_files_len={} compact_pointers_len={}",
            self.deleted_files.len(),
            self.new_files.len(),
            self.compact_pointers.len()
        );
    }
}

impl VersionEdit {

    /**
    | Add the specified file at the specified
    | number.
    |
    | REQUIRES: This version has not been saved
    | (see VersionSet::SaveTo)
    | REQUIRES: "smallest" and "largest" are
    | smallest and largest keys in file
    */
    pub fn add_file(
        &mut self,
        level:     i32,
        file:      u64,
        file_size: u64,
        smallest:  &InternalKey,
        largest:   &InternalKey
    )
    {
        trace!(
            "VersionEdit::add_file: level={}, file={}, file_size={}",
            level,
            file,
            file_size
        );

        let mut meta = FileMetaData::default();

        // FileMetaData::default() is expected to initialize refs/allowed_seeks.
        meta.set_number(file);
        meta.set_file_size(file_size);
        meta.set_smallest(smallest.clone());
        meta.set_largest(largest.clone());

        self.new_files_mut().push((level, meta));

        debug!(
            "VersionEdit::add_file: added file {} at level {} (size={})",
            file,
            level,
            file_size
        );
    }
}

impl VersionEdit {

    pub fn decode_from(&mut self, src: &Slice) -> Status {
        trace!("VersionEdit::decode_from: decoding from manifest record");

        self.reset_core_state();

        // Working copy of the input Slice.
        let mut input = unsafe {
            Slice::from_ptr_len(*src.data(), *src.size())
        };

        let mut msg: Option<&'static str> = None;
        let mut tag: u32 = 0;

        // Temporary storage for parsing
        let mut level: i32      = 0;
        let mut number: u64     = 0;
        let mut str_slice       = Slice::default();
        let mut key             = InternalKey::default();

        while msg.is_none() && get_varint32(&mut input, &mut tag) {
            match tag {
                1 => {
                    // kComparator
                    if get_length_prefixed_slice(&mut input, &mut str_slice) {
                        self.set_comparator_name(&str_slice);
                        debug!(
                            "VersionEdit::decode_from: parsed comparator '{}'",
                            str_slice.to_string()
                        );
                    } else {
                        msg = Some("comparator name");
                    }
                }
                2 => {
                    // kLogNumber
                    let mut log_num: u64 = 0;
                    if get_varint64(&mut input, &mut log_num) {
                        self.set_log_number(log_num);
                        debug!(
                            "VersionEdit::decode_from: parsed log_number={}",
                            self.log_number()
                        );
                    } else {
                        msg = Some("log number");
                    }
                }
                9 => {
                    // kPrevLogNumber
                    let mut prev_log: u64 = 0;
                    if get_varint64(&mut input, &mut prev_log) {
                        self.set_prev_log_number(prev_log);
                        debug!(
                            "VersionEdit::decode_from: parsed prev_log_number={}",
                            self.prev_log_number()
                        );
                    } else {
                        msg = Some("previous log number");
                    }
                }
                3 => {
                    // kNextFileNumber
                    let mut next_file: u64 = 0;
                    if get_varint64(&mut input, &mut next_file) {
                        self.set_next_file(next_file);
                        debug!(
                            "VersionEdit::decode_from: parsed next_file_number={}",
                            self.next_file_number()
                        );
                    } else {
                        msg = Some("next file number");
                    }
                }
                4 => {
                    // kLastSequence
                    let mut seq: u64 = 0;
                    if get_varint64(&mut input, &mut seq) {
                        self.set_last_sequence(seq as SequenceNumber);
                        debug!(
                            "VersionEdit::decode_from: parsed last_sequence={}",
                            self.last_sequence()
                        );
                    } else {
                        msg = Some("last sequence number");
                    }
                }
                5 => {
                    // kCompactPointer
                    if get_level(&mut input, &mut level)
                        && get_internal_key(&mut input, &mut key)
                    {
                        debug!(
                            "VersionEdit::decode_from: parsed compact pointer level={} key={:?}",
                            level,
                            key
                        );
                        self.set_compact_pointer(level, &key);
                    } else {
                        msg = Some("compaction pointer");
                    }
                }
                6 => {
                    // kDeletedFile
                    if get_level(&mut input, &mut level)
                        && get_varint64(&mut input, &mut number)
                    {
                        debug!(
                            "VersionEdit::decode_from: parsed deleted file level={} file={}",
                            level,
                            number
                        );
                        self.delete_file(level, number);
                    } else {
                        msg = Some("deleted file");
                    }
                }
                7 => {
                    // kNewFile
                    let mut file_level:  i32 = 0;
                    let mut file_number: u64 = 0;
                    let mut file_size:   u64 = 0;
                    let mut smallest_key      = InternalKey::default();
                    let mut largest_key       = InternalKey::default();

                    if get_level(&mut input, &mut file_level)
                        && get_varint64(&mut input, &mut file_number)
                        && get_varint64(&mut input, &mut file_size)
                        && get_internal_key(&mut input, &mut smallest_key)
                        && get_internal_key(&mut input, &mut largest_key)
                    {
                        let mut meta = FileMetaData::default();
                        meta.set_number(file_number);
                        meta.set_file_size(file_size);
                        meta.set_smallest(smallest_key.clone());
                        meta.set_largest(largest_key.clone());

                        debug!(
                            "VersionEdit::decode_from: parsed new file level={} number={} size={}",
                            file_level,
                            file_number,
                            file_size
                        );

                        self.new_files_mut().push((file_level, meta));
                    } else {
                        msg = Some("new-file entry");
                    }
                }
                _ => {
                    msg = Some("unknown tag");
                }
            }
        }

        if msg.is_none() && !input.empty() {
            msg = Some("invalid tag");
        }

        if let Some(reason) = msg {
            error!(
                "VersionEdit::decode_from: manifest record corruption: {}",
                reason
            );
            let context_slice = Slice::from("manifest parse error".as_bytes());
            let reason_slice  = Slice::from(reason.as_bytes());
            Status::corruption(&context_slice, Some(&reason_slice))
        } else {
            trace!("VersionEdit::decode_from: decode completed successfully");
            Status::ok()
        }
    }
}

impl VersionEdit {

    pub fn clear(&mut self) {
        trace!(
            "VersionEdit::clear: resetting mutable state \
             (preserving compact_pointers)"
        );
        self.reset_core_state();
    }
}


